import React from 'react';
import './'
import EventList from './EventList';
import RegistrationForm from './RegistrationForm';

const events = [
  { title: 'React Conference', date: '2024-09-01', description: 'A conference about React.', image: 'path/to/image.jpg', video: 'path/to/video.mp4' },
  { title: 'JavaScript Meetup', date: '2024-10-15', description: 'A meetup for JavaScript enthusiasts.', image: 'path/to/image2.jpg', video: 'path/to/video2.mp4' },
];


const Events = (event) => {
  return (
    <div className="App">
      <h1>Upcoming Events</h1>
      <EventList events={events} />
      <RegistrationForm />
    </div>
  );
};
 


export default Events
